response.about:
Трудно говорить о себе в первом лице. Но попробую:

- люблю жизнь, люблю открытых и светлых людей с активной   жизненной позицией. Мне не симпатичны пессимисты и нытики. Моим  девизом являются слова: "Все в твоих руках"; 

- любимая песня "Надежда" А.Герман, "Город, которого нет" И.Корнедюка;

- если говорить о смысле жизни, то "смысл жизни - это уже вопрос веры. Во что веришь - таков ты и есть" (М. Анчаров);

- а еще я знаю, что нет ничего случайного, ведь "эти люди и эти события твоей жизни оказались здесь потому, что ты сам их сюда привел" (Р. Бах)
